import React from "react";

const GetInTouch = ({ heading, message, email, phone }) => {
  return (
    <>
      <h2 className="display-4 pb-3 text-center mt-5">{heading}</h2>
      {/* <p className="lead text-center pb-3">
        {message}, <a href={`mailto:${email}`}>{email}</a>.
      </p> */}
      <i className="huge phone icon phone-section" ></i>
      <p className="d-inline-block phone-section">{phone}</p>
      <i className="huge envelope outline icon email-section ml-5"></i>
      <a id="email-link" href="mailto:valensh1@yahoo.com">{email}</a>
      <i className=" huge github icon contact-social-media"></i>
      <i className="huge linkedin icon contact-social-media"></i>

    </>
  );
};

export default GetInTouch;
